import React,{Component} from 'react';
class Comp extends Component{
    constructor(){
        super();
        this.state = {
            color : 'red'
        }
    }
    changeit = () =>{
        this.setState(
            {
                color : 10
            }
        )
    };
    render(){
        return (
           <React.Fragment>
               <button onClick={this.changeit()}>click here</button>
               <p>{this.state.color}</p>
           </React.Fragment>
        )
    }
     changeit() {
        alert("dfsd")
    };
}

export default Comp;
